import React, { Component } from "react";
import { reduxForm, Field, getFormValues } from "redux-form";

import "./LogIn.css";
import { Button, Form } from "antd";
import { connect } from "react-redux";
import { compose } from "redux";

class LoginForm extends Component {
  formSubmit = e => {
    e.preventDefault();

    console.log("hi");

    console.log(this.props.form);
    const { handleSubmit, signIn } = this.props;

    // let LoginForm = ({ handleSubmit, submitting }) => {
    //
    handleSubmit(this.showResults())();
  };
  showResults = values => {
    window.alert(`You submitted:\n\n${JSON.stringify(values, null, 2)}`);
  };

  render() {
    return (
      <Form
        autoComplete="off"
        className="login-form paper"
        // onSubmit={handleSubmit(showResults)}
        onSubmit={this.formSubmit}
      >
        {/* <form className="login-form paper" onSubmit={handleSubmit(showResults)}> */}
        <h1>Log in</h1>

        <div className="auth-form-field">
          <label> User name </label>
          <Field
            name="username"
            component="input"
            type="text"
            placeholder="First Name"
          />
        </div>
        <div className="auth-form-field">
          <label> Password </label>
          <Field
            name="password"
            component="input"
            type="password"
            placeholder="Last Name"
          />
        </div>
        <div className="auth-form-field">
          <label> Email </label>
          <Field
            name="email"
            component="input"
            type="text"
            placeholder="Email"
          />
        </div>
        <Button disabled={false} htmlType="submit" type="primary">
          Sign in
        </Button>
        {/* </form> */}
      </Form>
    );
  }
}
const mapDispatchToProps = {}; //signIn

const enhance = compose(
  connect(null, mapDispatchToProps),
  reduxForm({ form: "login" })
);

export default enhance(LoginForm);
